from statistics import mean
from timeit import repeat

_setupA = '''
import ex096a as a
'''

_setupB = '''
import ex096b as a
'''

code = '''
a.isInteger(' - ')
'''

print("ex096a -> ", mean(repeat(stmt=code, setup=_setupA, repeat=10, number=1000)))
print("ex096b -> ", mean(repeat(stmt=code, setup=_setupB, repeat=10, number=1000)))
